import React from "react";
import { Link } from "react-router-dom";

// Style
import { Wrapper,Content } from "./BreadCrumb.styles";


const BreadCrumb = ({movieTitle}) => (
    <Wrapper>
        <Content>
            <Link to='/'>
                <span>Home</span>
            </Link>
            <span>|</span>
            <span>{movieTitle}</span>
        </Content>
    </Wrapper>
);

export default BreadCrumb;
